import Router  from '../../routes';
import {LanguageProvider} from '../../contexts';
import { useContext } from 'react';

export default function App() {
    const { language } = useContext(Language);

    return (
    <LanguageProvider>
        <main className='container'>
            <Router />
        </main>
    </LanguageProvider>
    );
}
